import React, { useState, useEffect } from 'react';
import { useNavigate } from "react-router-dom";


const AllLoan = () => {
  const [data, setData] = useState('');
  const [loader, setLoader] = useState(false);
  const navigate = useNavigate();

  const email = localStorage.getItem("email");

  useEffect(() => {
        setLoader(true);
        var result = LoanList(page, displayPage);
        result.then((response) => {
            setData(response.data)
            setLoader(false);
        });
    });

  return (
    <>
    {loader ? (
      <>
        <div className="loader-setting">
          <div
            className="spinner-border d-flex align-items-center justify-content-center"
            role="status"
          >
            <span className="sr-only">Loading...</span>
          </div>
        </div>
      </>
    ) : (
      <>
        <main>
          <div id="main" className="pb-0">
            <div className="main-wrap">
              <div className="container pt-4 pb-5">
                <div className="row  submission-rowwrap">
                  <div className="col-md-12">
                    <div className="card dashboard-box addagent-datatable submissions-tabs-view">
                      <h3 className="h3-wrapheading mt-2 mb-4 pb-2  text-start">
                        Agents
                      </h3>
                      <div className="col-sm-12">
                        <div className="viewagent-datatable table-responsive">
                          <table className="table" id="table-width">
                            <thead>
                              <tr>
                                <th scope="col">Name</th>
                                <th scope="col">Email</th>
                                <th scope="col">Loan Amount</th>
                                <th scope="col">Weekly Payment</th>
                                <th scope="col">Weekly Payment Date</th>
                                <th scope="col">Status</th>
                                <th scope="col" width="10%">
                                  Action
                                </th>
                              </tr>
                            </thead>
                            <tbody>
                              {data?.length !== 0 &&
                                data?.map((items, index) => (
                                  <>
                                    <tr key={index}>
                                      <td>{items.name}</td>
                                      <td>{items.createdBy}</td>
                                      <td>{items.loan_amount}</td>
                                      <td>{items.weekly_payment}</td>
                                      <td>"12/31/2023"</td>
                                      <td>{items.loan_approved}</td>
                                      <td>
                                        <div
                                          className="border-0 d-flex"
                                          style={{ width: "150px" }}
                                        >
                                          <select
                                            key={index}
                                            value={selectedOption}
                                            onChange={(e) =>
                                              handleChange(
                                                e,
                                                items._id,
                                                items.username,
                                              )
                                            }
                                          >
                                            <option value="">Select</option>
                                            <option
                                              key={`edit-${index}`}
                                              value={"edit" + items._id}
                                              onClick={() =>
                                                _EditAgentData(items._id)
                                              }
                                            >
                                              Edit Agent
                                            </option>
                                            <option
                                              key={`delete-${index}`}
                                              value={"delete" + items._id}
                                              onClick={() =>
                                                _DeleteAgentData(items._id)
                                              }
                                            >
                                              Delete Agent
                                            </option>
                                            <option
                                              key={`viewpolicy-${index}`}
                                              value={"viewpolicy" + items._id}
                                              onClick={() =>
                                                _ViewPolicyData(
                                                  items._id,
                                                  items.username,
                                                )
                                              }
                                            >
                                              View Policy
                                            </option>
                                            <option
                                              key={`setPassword-${index}`}
                                              value={
                                                "setPassword" + items._id
                                              }
                                              onClick={() =>
                                                _SetPassword(
                                                  items._id,
                                                  items.username,
                                                )
                                              }
                                            >
                                              Set Password
                                            </option>
                                          </select>
                                        </div>
                                      </td>
                                    </tr>
                                    {showPolicy === items._id &&
                                      policyDisplay.length !== 0 && (
                                        <tr>
                                          <td
                                            colSpan={8}
                                            className="text-start"
                                          >
                                            <table className="table table-borderless">
                                              <thead>
                                                <tr>
                                                  <th>QuoteId</th>
                                                  <th>Insured Name</th>
                                                  <th>Effe Date</th>
                                                </tr>
                                              </thead>
                                              <tbody>
                                                {policyDisplay?.map(
                                                  (policy, index) => (
                                                    <tr key={index}>
                                                      <td>
                                                        {policy.quoteId}
                                                      </td>
                                                      <td>
                                                        {
                                                          policy.legal_business_name
                                                        }
                                                      </td>
                                                      <td>
                                                        {policy.EffectiveDate}
                                                      </td>
                                                    </tr>
                                                  ),
                                                )}
                                              </tbody>
                                            </table>
                                          </td>
                                        </tr>
                                      )}
                                    {showPolicy === items._id &&
                                      policyDisplay.length === 0 && (
                                        <tr>
                                          <td colSpan={10}>No data</td>
                                        </tr>
                                      )}
                                  </>
                                ))}
                            </tbody>
                          </table>
                        </div>
                        <div className="card-footer pb-0 pt-3 pagination-cards">
                          {pager?.pages && pager?.pages.length && (
                            <ul className="pagination">
                              <li
                                className={`page-item first-item ${
                                  pager.currentPage === 1 ? "disabled" : ""
                                }`}
                              >
                                <Link
                                  to={`/view-agents/1/${displayPage}`}
                                  className="page-link"
                                >
                                  First
                                </Link>
                              </li>
                              <li
                                className={`page-item previous-item ${
                                  pager.currentPage === 1 ? "disabled" : ""
                                }`}
                              >
                                <Link
                                  to={`/view-agents/${
                                    pager.currentPage - 1
                                  }/${displayPage}`}
                                  className="page-link"
                                >
                                  Previous
                                </Link>
                              </li>
                              {pager.pages.map((page, index) => (
                                <li
                                  key={index}
                                  className={`page-item number-item ${
                                    pager.currentPage === page ? "active" : ""
                                  }`}
                                >
                                  <Link
                                    to={`/view-agents/${page}/${displayPage}`}
                                    className="page-link"
                                  >
                                    {page}
                                  </Link>
                                </li>
                              ))}
                              <li
                                className={`page-item next-item ${
                                  pager.currentPage === pager.totalPages
                                    ? "disabled"
                                    : ""
                                }`}
                              >
                                <Link
                                  to={`/view-agents/${
                                    pager.currentPage + 1
                                  }/${displayPage}`}
                                  className="page-link"
                                >
                                  Next
                                </Link>
                              </li>
                              <li
                                className={`page-item last-item ${
                                  pager.currentPage === pager.totalPages
                                    ? "disabled"
                                    : ""
                                }`}
                              >
                                <Link
                                  to={`/view-agents/${pager.totalPages}/${displayPage}`}
                                  className="page-link"
                                >
                                  Last
                                </Link>
                              </li>
                            </ul>
                          )}
                        </div>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </main>
      </>
    )}
  </>
  );
};

export default AllLoan
